import React from 'react';
import {G, Line, Circle} from 'react-native-svg'

export default function Tooltip({ x, y, swipeIndex, data }){
    console.log(data)
    if(swipeIndex >= 0 && swipeIndex <= data.length){
        return (
            <G x={ x(swipeIndex) - (75 / 2) }>
            <G x={ 75 / 2 }>
                <Line
                  y1={ 120 }
                  y2={ 0 }
                  stroke={ 'rgba(41, 114, 255, 0.7)' }
                  strokeWidth={ 1 }
                />
                <Circle
                    cy={ y(data[swipeIndex][1])}
                    r={ 4 }
                    fill={ 'rgb(41, 114, 255)' }
                />
            </G>
          </G>
        )
    }
    else{
        return (null);
    }
}
